import { ArrowOutwardSharp } from "@mui/icons-material";
import { Box, Typography } from "@mui/material";
import React from "react";

function Footer() {
  return (
    <Box
      sx={{
        backgroundImage: "linear-gradient(45deg, #3593B0 0%, #4A9B85 100%)",
        maxWidth: "120%",
        margin: "0 auto",
        padding: 0,
        height: "400px",
      }}
    >
      <Typography
        sx={{
          fontFamily: "Manrope, sans-serif !important",
          padding: 3,
          alignItems:'center',
          fontSize: "1.8rem",
          fontWeight: "500",
          color: "white",
          lineHeight: 1.2,
          position:'relative',
          display: "inline-block",
          "&::after": {
            content: '""',
            position: "absolute",
            right:0,
            borderRadius: "5px",
            bottom: "5px",
            maxWidth: "100%",
            height: "4px",
            backgroundColor: "white",
          },
        }}
      >
        Trending on MMM <ArrowOutwardSharp fontSize="inherit" />
      </Typography>
    </Box>
  );
}

export default Footer;
